import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import AppBar from './app/features/appbar/AppBar';
import Dashboard from './app/features/dashboard/Dashboard';
import PrivateRoute from './app/features/routes/PrivateRoute';
import PublicOnlyRoute from './app/features/routes/PublicOnlyRoute';
import Login from './app/features/sessions/Login';
import Logout from './app/features/sessions/Logout';
import PersistLogin from './app/features/sessions/PersistLogin';
import SigneIn from './app/features/sessions/SigneIn';
import Signup from './app/features/sessions/Signup';
import SignUpNow from './app/features/sessions/SignUpNow';
import UpdateProfile from './app/features/sessions/UpdateProfile';

function App() {
  return (
    <div className="App">
      <Router>
      <header className="App-header">
        <AppBar />
      </header>
      <main>
        <Routes>
          <Route element={<PersistLogin />}>
            <Route path="/" element={
              <PrivateRoute>
                <Dashboard />
              </PrivateRoute>
            } />
            <Route path="/logout" element={
              <PrivateRoute>
                <Logout />
              </PrivateRoute>
            } />
            <Route path="/update-profile" element={
              <PrivateRoute>
                <UpdateProfile/>
              </PrivateRoute>
            }/>
            <Route path="/login" element={
                <PublicOnlyRoute>
                  <Login />
                  {/* <SigneIn /> */}
                </PublicOnlyRoute> 
              }/>
              <Route path="/signup" element={
                <PublicOnlyRoute>
                  {/* <Signup /> */}
                  <SignUpNow />
                </PublicOnlyRoute> 
              }/>
          </Route>
        </Routes>
      </main>
      </Router>
    </div>
  );
}

export default App;
